// Translate handler
cari.onclick = function (e) {
  e.preventDefault();
  let nilai = ambilFrom();
  tampilHasil(nilai);
};

function ambilFrom() {
  let nilai = from.value;
  return nilai;
}

function tampilHasil(str) {
  let awal = psikologi[(str.toLowerCase().trim())]
  if (awal == undefined) {
    to.value = str;
  } else {
    to.value = awal;
  }
}

// Realtime handler
realtime.addEventListener("click", function (e) {
  if (realtimeStatus == 0) {
    realtimeStatus = 1;
  } else {
    realtimeStatus = 0;
  }
});

// From keyup handler
from.addEventListener("keyup", function (e) {
  if (realtimeStatus == 1) {
    let nilai = ambilFrom();
    tampilHasil(nilai);
  }
});
